import React from 'react';
import Navbar from './navbar';

const Body = () => {
    return(
        <div>
            <Navbar/>
            {['Hello', 'Wassup', 'Hey there'].map((stuff)=>{
                return <div>
                    <h2>{stuff}</h2><button>Add</button><button>Remove</button>
                </div>
            })}
        </div>
    );
}

export default Body;
